window.bookSummaryJSON = "<p>I can't sleep with the nanny - or get her pregnant....</p> <p>Nannies never last long under my roof. They all kind of hate me - Natasha, the newest one, included. My kids are unruly and all under seven. They say I'm distant and cold. </p> <p>But when Natasha takes over, finally, things start falling into place. She's sweet, innocent, and beautiful. I'd do anything for her. </p> <p>She says we need to keep it platonic, for the kids. But her curves call to me. We can't keep our hands off each other. </p> <p>Our family is about to get a whole lot more complicated...when we find out she's having twins. </p> <p>Contains mature themes.</p>"; 
